import React from "react";

const RealisationsPage = () => {
  return (
    <div className="min-h-screen bg-gray-100 flex flex-col items-center justify-center p-10">
      <h1 className="text-4xl font-bold text-gray-800 mb-6">Nos Réalisations</h1>
      <p className="text-gray-600 text-lg max-w-3xl text-center">
        Découvrez nos projets innovants en Data Science et Intelligence Artificielle.
      </p>
    </div>
  );
};

export default RealisationsPage;
